import axios from "axios"
import { useEffect } from "react";
import Data from "./"

export default function DataLogements() {
    const getData = () => {
        axios
        .get("../Data/Data.json")
         .then((response) => console.log(response.data))
         .catch((err) => console.log(err));
    };

    useEffect(() => {
        getData()
    }, []);

    return <div>Axios</div>
}
